syntax = "proto2";

package MMPro.micromsg;

import "BaseResponse.proto";
import "SKBuiltinBuffer_t.proto";

message DownloadVideoResponse {
	required BaseResponse _BaseResponse = 1;
	required uint32 _MsgId = 2;
	required uint32 _TotalLen = 3;
	required uint32 _StartPos = 4;
	required SKBuiltinBuffer_t _Data = 5;
	optional uint64 _NewMsgId = 6;
}
